[mod-setting-description]
rampant-unitSpawnerBreath=现在单位的产卵者呼吸空气，所以他们会受到类似毒胶囊的影响
rampant-useDumbProjectiles=使用可阻挡的射弹攻击。如果你使用新的敌人，应该检查一下。
rampant-attackWaveGenerationUsePlayerProximity=以玩家接近作为触发条件，将生成一个攻击临界值。不影响正常子的攻击条件。
rampant-attackWaveGenerationThresholdMax=虫族必须达到强壮的总分数，才会攻击、产卵。不影响正常子的攻击条件。（启动临界值0进化）
rampant-attackWaveGenerationThresholdMin=虫族必须达到强壮的总分数，才会攻击、产卵。不影响正常子的攻击条件。（终止临界值100进化）
rampant-attackWaveMaxSize=如果你想改变攻击波如何随着进化而扩展，你需要修改zip文件中的config.lua。
rampant-safeBuildings=这需要切换安全建筑切换才能工作。这将导致安全的实体使用设置为false的可破坏标志重新生成，这将导致它们不再成为目标或受到损坏。
rampant-safeBuildings-curvedRail=使曲线铁轨免于被虫族攻击
rampant-safeBuildings-straightRail=使直线铁轨免于被虫族攻击
rampant-safeBuildings-bigElectricPole=使远程输电塔免于被虫族攻击
rampant-safeBuildings-railChainSignals=使联锁铁路信号灯免于被虫族攻击
rampant-safeBuildings-railSignals=使基础铁路信号灯免于被虫族攻击
rampant-safeBuildings-lamps=使灯免于被虫族攻击
rampant-safeBuildings-trainStops=使火车站免于被虫族攻击
rampant-attackPlayerThreshold=块必须达到的分数才能有助于攻击阈值。 增加会减少玩家信息素云的影响。
rampant-permanentNocturnal=切换此选项将导致在晚上生成狂暴攻击波。 尚不关闭香草攻击组。 与Day / Night扩展程序mod搭配使用效果更好。
rampant-aiPointsScaler=在0.0和5.0之间。 这样可以缩放每个逻辑周期AI可以获得多少个动作点，以执行诸如发出攻击波之类的动作。 0.3-非常容易，0.75-容易，1.0-中，1.25+-硬
rampant-addWallResistanceAcid=切换此设置将导致向所有墙体添加％60的耐酸性，以减少因飞溅物使墙体回到原始水平而造成的损坏。
rampant-removeBloodParticles=去除子的流血效果，增加UPS，使电脑变快。
rampant-enableSwarm=这减少了单位碰撞的大小，从而减少了路径冲突并消除了攻击
rampant-attack-warning=显示一条消息警告玩家攻击波正在来袭。
rampant-newEnemies=添加将分散在世界各地的敌人。 这增加了RAM需求。 每个咬合，蠕虫和巢穴都有1种变化形式，并有5个层级，预计最多可增加2GB RAM。 随着20个版本和10个层的设置，预计最多可增加9GB RAM。 变异会增加每层苦味，蠕虫或巢穴的随机性。 等级是咬人的力量等级。
rampant-enemySeed=如果你想让敌方的统计信息发生变化，那就改变这一点。
rampant-deadZoneFrequency=创建地图时虫虫族占有初始区域空间的百分比。
rampant-newEnemyNestVariations=这个数字对应于每级的变化数量。数字越高，敌方的力量曲线越平滑。最小1，最大20。
rampant-newEnemyNestTiers=这个数字对应于层数。数字越高，敌方的力量曲线越平滑。
rampant-newEnemyWormVariations=这个数字对应于每级的变化数量。数字越高，敌方的力量曲线越平滑。最小1，最大20。
rampant-newEnemyWormTiers=这个数字对应于层数。数字越高，敌方的力量曲线越平滑。
rampant-newEnemyUnitVariations=这个数字对应于每级的变化数量。数字越高，敌方的力量曲线越平滑。最小1，最大20。
rampant-newEnemyUnitTiers=这个数字对应于层数。数字越高，敌方的力量曲线越平滑。
rampant-enableBobsUnits=在基本升级和放置列表中添加Bob MOD的虫巢，单元和蠕虫。
rampant-enableNEUnits=在基本升级和放置列表中添加自然演化MOD的虫巢，单元和蠕虫。
rampant-disallowFriendlyFire=防止敌人通过溅射伤害破坏单位或建筑。
rampant-tierStart=这是敌人初始等级，并且对于所选的等级，线性增加到最终等级。最小1，最大10。
rampant-tierEnd=这是敌人最高等级，在从所选等级的起始等级线性增加后达到。最小1，最大10。
rampant-forceOldProjectiles=这使得自动推进的武器不再对其他实体产生影响。
rampant-disableVanillaAI=这将关闭原版的攻击波和原版虫族的扩张。
rampant-enableMigration=这将允许AI扩展其蠕虫和巢穴。关联虫族扩张的地图设置。

rampant-enableShrinkNestsAndWorms=将巢和蠕虫的碰撞箱尺寸减小50％。 由于碰撞盒小于实体图形，可能导致重叠的实体。

rampant-unkillableLogisticRobots=这将使物流机器人免受所有损害
rampant-unkillableConstructionRobots=这将使建筑机器人不受所有伤害

rampant-aiAggressiveness=此设置直接影响ai进入和平状态的频率。 少于一者将使咬人更具攻击性，大于一者将使咬合者变得更和平。 将此设置为零将导致AI永远无法安宁。 0-2

